import React from 'react';
import Home from './Home';
import About from './About';
import Service from './Service';
import Contact from './Contact';
import { Route } from 'react-router-dom';

const App = () => {
  return (
    <>
      <Route path="/" component={Home}></Route>
      <Home />
    </>
  );
}

export default App;
